(10, 'Informations', 'lamino_footer_middle4', '<h6>Informations</h6>\n<ul>\n	<li><a href="#">Recalls</a></li>\n	<li><a href="#">Return Policy</a></li>\n<li><a href="{{store direct_url="about-magento-demo-store"}}">About Us</a></li>\n<li><a href="{{store direct_url="contacts"}}">Contact Us</a></li>\n<li><a href="{{store direct_url="customer-service"}}">Customer Service</a></li>\n<li><a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Privacy Policy</a></li>\n<li><a href="{{store direct_url="blog"}}">Blogs</a></li>\n</ul>', '2014-12-03 01:39:49', '2014-12-03 01:39:49', 1),
